import './header.css';

const Header = () => {
    return(
        <div className="header">
            <img src="https://na-oboi.ru/images/product_images/info_images/futbolnyj_myach_art_249TR.png"/>
            <div className="title">Football Talks</div>
            <div className="enter">
                Вход
            </div>
            <div className="registration">
                Регистация
            </div>
        </div>
    );
}

export default Header;
